import React, { Component } from 'react'

export default class About extends Component {
    render() {
        return (
        <div className="container section about">
          <div className="card z-depth-0">
           <div className="card-content">
            <span className="card-title">About Rate My Student</span>
              <p>At Rate My Students Professors can create profiles of their beloved students or their worst experience.
This is a chance for students who want to increase their good reputation, to display to hiring managers, recruiters, and organizations.
The idea of Rate My Students  is to create a public community where professors can provide ratings and recomendations for their students.
Rate My Students Allow the users to create profiles of the students and comment on them, describing their behaviors</p>
           </div>
          </div>
        </div>
        )
    }
}
